import Vue from 'vue';
import App from './App.vue';
import VueRouter from "vue-router";
import ContactsForm from './components/ContactsForm.vue';

console.log(ContactsForm)
console.log(VueRouter)

Vue.use(VueRouter);

Vue.config.productionTip = false;

 const routes = [
   {
     name: 'lang',
     path: "/:lang",
     component: ContactsForm,
   },
   {
     name: 'projects',
     path: "/projects",
     component: ContactsForm,
     meta: {
      nameRus: "Проекты",
     }
   },
   {
     name: 'about',
     path: "/about",
     component: ContactsForm,
     meta: {
      nameRus: "О компании",
     }
   },
   {
     name: 'contacts',
     path: "/contacts",
     component: ContactsForm,
     meta: {
      nameRus: "Контакты",
     }
   },
   {
     path: "*",
     redirect: "/contacts",
     //alias: '*',
     component: ContactsForm,
   },
 ];

 const router = new VueRouter({
   routes,
   mode: "history",
 });

 console.log(router)

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
